    // ObtÃ©m ID do post (se estiver dentro de caption)
    const postId = post.caption?.id || "ID nÃ£o encontrado";

    // ObtÃ©m o texto da postagem
    const postText = post.caption?.text || "Sem texto";

    // ObtÃ©m o nome do usuÃ¡rio
    const userName = post.caption?.user?.full_name || "UsuÃ¡rio desconhecido";

    // Extrai a URL principal de cada imagem do carrossel (corrigindo a duplicaÃ§Ã£o)
    const imageUrls = post.carousel_media
